pragma solidity ^0.5.0;

contract Election {

    uint electionCounter = 0;

    struct Vote {
        uint electionID;
        bool value;
        address user;
    }

    struct Election {
        address creator;
    }

    Vote [] votes;


    mapping (uint  => Election) public idToElection;


    function createVoting () public {
        electionCounter++;
        idToElection[electionCounter] = Election(msg.sender);
    }

    function vote (uint _electionID, bool _voteValue) public {
        votes.push(Vote(_electionID,_voteValue,msg.sender));
    }


}
